import { useEffect, useState } from 'react';
import './App.css';

const APIAccessKey = "6PMB_sssC924TiZ3jPaY4Iwo4KZ0E6d6xZ0dgSbK4_g";
const APISecretKey = "eYD6_TkHUu5qhbAmLSx28hFlhl4101jKBTH_vNyJiVE";

function App() {
  const [api, setAPI] = useState("");
  useEffect(() => {
    fetch("https://api.unsplash.com/photos/?client_id=" + APIAccessKey
    + "&query=land scape")
    .then(respond => respond.json())
    // .then(data => console.log(data[0].alt_description))
    .then(data => setAPI(data[0].alt_description))
  })
  return (
    <div className="App">
      <p>{api}</p>
    </div>
  );
}

export default App;
